import React from "react";
import cake from "./cake.png";
import brunch from "./brunch.png";
import kushcake from "./kushcake.png";

const Portfolio = () => {
  console.log(window.location.pathname);

  return (
    <div className="portfolio" style={{display:'flex'}}>
    <div className = 'graphic-art-section'>
      <div className="graphic-art" style={{width:'33%'}}><img width='80%' style={{marginLeft:'10%'}} src={brunch}/></div>
      <div className="graphic-art" style={{width:'33%'}}><img width='80%' style={{marginLeft:'10%'}}  src={cake}/></div>
      <div className="graphic-art" style={{width:'33%'}}><img width='80%' style={{marginLeft:'10%'}}  src={kushcake}/></div>
      </div>
    </div>
  );
};

export default Portfolio;
